comments.message:
convention is callbacks start with 

if (ec){
   // Handle error
   return;
}

When `TOTPAuthenticatorManager` is not present, Redfish-Event-Listener causes an error like
```
Dec 10 20:05:34 p10bmc bmcwebd[286]: [ERROR redfish_sessions.hpp:331] secretKeyRequired check failed = Invalid request descriptor
Dec 10 20:05:34 p10bmc bmcwebd[286]: [CRITICAL error_messages.cpp:1356] Internal Error /usr/src/debug/bmcweb/1.0+git/redfish-core/lib/redfish_sessions.hpp(332:40) `redfish::handleSessionCollectionPost(crow::App&, const crow::Request&, const std::shared_ptr<bmcweb::AsyncResp>&)::<lambda(const boost::system::error_code&, bool)>`:
```

I think - when TOTPAuthenticatorManager is not installed, this is happening.

Should we check if(ec.value() == EBADR) to bypass?

```
diff --git a/redfish-core/lib/redfish_sessions.hpp b/redfish-core/lib/redfish_sessions.hpp
index 87fe694e..a408d85b 100644
--- a/redfish-core/lib/redfish_sessions.hpp
+++ b/redfish-core/lib/redfish_sessions.hpp
@@ -327,10 +327,13 @@ inline void handleSessionCollectionPost(
                       const boost::system::error_code& ec, bool required) {
             if (ec)
             {
+                if (ec.value() != EBADR)
+                {
                    BMCWEB_LOG_ERROR("secretKeyRequired check failed = {}",
                                     ec.message());
                    messages::internalError(asyncResp->res);
                    return;
+                }
             }
             std::shared_ptr<persistent_data::UserSession> session =
                 persistent_data::SessionStore::getInstance()

```
